    - La façon dont les programmes sont installés sous Ubuntu. Normalement, un programme
      ne contient que son cœur, il décrit dans son installateur d'autres programmes
      dont il dépend (par exemple, une librairie de sécurité). Quand il y a une mise
      à jour de cette librairie, tous les programmes qui en dépendent en profitent.
      Ubuntu veut tenter une autre approche, faire de chaque programme un "stand-alone"
      (comme sous Windows), où chaque logiciel embarque l'ensemble des librairies
      dont il a besoin pour fonctionner.
