    - "Message envoyé ce vendredi aux joyaux apiculteurs de Wavre (copie par mail
      pour les dames qui ne suivent pas encore les news du collector :-)        (vivement
      qu'on puisse ajouter l'un ou l'autre smiley)\r\n========================\r\nBonjour,\r\nJe
      réside entre le village expo et le château de Rixensart. Au cas où un apiculteur
      serait à la recherche d'un emplacement pour une ou deux ruches, je pense que
      le jardin de ma propriété pourrait offrir le gîte à l'un ou l'autre essaim.
      Calme assuré, quartier aéré, voisinage assez fleuri, bois de Mérode à 200m....\r\nDepuis
      3 ans, j'accueille en France plusieurs essaims (jusqu'à 7 par an sur 2 ruches
      d'accueil). L'apiculteur local a carte blanche absolue pour la gestion de ses
      ruches et emporte les essaims pour les ré-installer dans des ruches plus grandes
      en des endroits souhaités/proposés par les agriculteurs du coin.\r\nJe ne suis
      pas opposé à participer aux frais d'acquisition de la /des ruches.\r\nJe suis
      adhérant depuis plusieurs années de Pollinis (http://www.pollinis.org) que la
      famille encourage ponctuellement à lutter pour la suppression des néonicotinoïdes
      et à développer via l'université de Nantes un moyen naturel et efficace d'éradication
      des nids de frelons asiatiques (http://www.pollinis.org/programme-frelon-asiatique/)\r\nBien
      cordialement et à bientôt j'espère\r\n(Martine et) Luc Vergeylen\r\n========================"
