    - "Extrait d'une offre d'emploi chez Eolane :\r\nDescription de l'offre\r\nVous
      êtes en charge de la plateforme logicielle LINUX destinées aux solutions microprocesseur
      de éolane. Vous gérerez une roadmap technique et serez amené à adapter celle-ci
      en fonction des projets de nos clients et des directives techniques internes.
      Vous mettrez à disposition ces distributions aux projets internes ou externes
      et équipes industrielles et en assurerez le support.\r\n\r\n\r\nPour cela vos
      missions principales seront les suivantes :\r\n\r\n-Maintenance évolutive et
      corrective de BSP LINUX (Basic Software Package) et distributions Linux ( sous
      YOCTO et BUILDROOT) destiné aux cartes microprocesseur embarquées développées
      et produits par éolane (principalement cœur ARM) ;\r\n-Intégration de nouveaux
      drivers, aide à la décision pour le choix des nouveaux périphériques lors de
      conception électronique ;\r\n-Promouvoir, maintenir et faire évoluer une 'chaine
      d'intégration continue', outils et pratiques associées ;\r\n-Mise en place des
      scripts et outils pour tests des cartes en fin de chaîne ;\r\n-Produire de la
      documentation pour l'ensemble, à l'attention de la communauté cliente de la
      solution ;\r\n-Former les nouveaux utilisateurs sur l'usage de ces SDK ;\r\n-Veille
      technologique sur les technologies logicielles et conseil sur la question vers
      la direction technique​\r\n-Déploiement et maintenance en conditions opérationnelle
      des outils hébergés sur serveur Linux (VM) à l'usage de la R&D ;\r\n\r\n-Compétences
      pour le déploiement d'applications hébergés sur le cloud​\r\n\r\nProfil souhaité\r\nIngénieur
      ou diplômé d'un Master en génie Logiciel, vous disposez d'au moins 5 années
      d'expérience R&D dans un domaine similaire.\r\n\r\n\r\nConnaissances pratiques
      (Savoir Faire)\r\n-Compiler le noyau linux, configurer ses drivers, intégrer
      un nouveau driver, éventuellement l'adapter\r\n-Industrialiser une distribution
      (scripter, figer, valider, distribuer)\r\n-Debug sur carte de périphérique\r\n-Diagnostiquer
      un système micro : ressources, stabilité, qualité logiciel\r\n-Connaitre le
      monde de l'open source, savoir sourcer des solutions, maitriser la problématique
      des licences\r\n-Notions de 'roadmap produit', pilotées par la technique et
      les choix stratégiques\r\n\r\nAptitudes comportementales et relationnelles (Savoir
      Etre)\r\n-Communiquer, savoir s'interfacer avec des clients (internes, externes)\r\n-Esprit
      de synthèse, malgré la complexité du métier\r\n-Capacité d'analyse et identifier
      les solutions les plus simples et les plus sûres\r\n-Savoir s'interfacer avec
      des métiers différents : industrie, test, conception hard et conception applicative\r\n\r\n​Connaissances
      clés nécessaires (Savoirs)\r\n-Expert Linux\r\n-C, Shell scripting, Pyton, C++,
      Qt, Java embarqué.\r\n-Outils de gestion de distribution : YOCTO et BUILDROOT\r\n-Chaines
      de compilation GCC\r\n-Outils d'intégration continue : JENKINS\r\n-Technologies
      de sécurisation, d'obfuscation, de packaging logiciel\r\n"
