    - "\"L'imparable supériorité technologique du livre papier\"\r\n\r\nChicago. 28
      janvier 2046. Une foule compacte de jeunes de la génération bêta se presse devant
      le MBOC (Michelle & Barack Obama Center), superbe bâtiment à la forme d'une
      colombe. Ils répondent à l'invitation du jeune startupperqui monte, Mark Gutenberg,
      dont la légende veut que sa mère ait choisi le prénom en hommage à celui qui
      est devenu président des Etats-Unis après avoir fait fortune avec un réseau
      appelé Facebook.\r\n\r\nLe secret le plus absolu a été tenu sur l'objet de cette
      keynote intitulée #FreeYourself. Tout juste Mark Gutenberg a-t-il laissé entendre
      qu'il s'agissait d'un produit très disruptif et que les participants vivraient
      un moment expérientiel unique capable de libérer leur vie à jamais. Cette conférence
      ne sera d'ailleurs pas retransmise sur les réseaux. De même qu'il a été instamment
      demandé aux invités de se présenter sans leurs lunettes ou lentilles de contact
      VR, ni leur iPhone 28 ou Galaxy SX54. Toutes les puces sous-cutanées sont soigneusement
      désactivées à l'entrée. Chacun trouve sur son siège un petit paquet cadeau avec
      la mention Do not open.\r\n\r\nArrive alors sur scène, dans un effet de halo,
      le jeune Mark Gutenberg. Sans prompteur. Derrière lui, pas d'hologramme ni d'écran
      géant, juste un grand rideau de velours pourpre. Comme tous les participants,
      il tient un cadeau. Il le déballe et demande à la salle de faire de même : \"
      Et voilà l'objet \". Dans la salle, tous le scrutent sous tous les angles. Chacun
      en possède un différent avec une couverture aux couleurs chatoyantes et des
      titres divers. En l'ouvrant, ils découvrent des feuilles de papier fixées à
      une tranche et un texte comme ceux qui défilent dans leurs lunettes de réalité
      virtuelle ou ceux que leur débitent leurs robots.\r\n\r\n\" Il fonctionne sans
      batterie, continue Mark Gutenberg, sans connexion et bénéficie d'une autonomie
      illimitée. Nul besoin de le recharger, ni de le réinitialiser. Parfaitement
      nomade, vous pouvez l'emporter partout avec vous à la plage ou même sur une
      île déserte. \" Tous l'ouvrent et plongent leur nez au coeur des pages. \" Vous
      sentez ? Il dégage un parfum. C'est aussi un bel objet de décoration, original.
      Vous pouvez en changer tous les jours et le collectionner sur des étagères.
      \" A ce moment-là, le rideau pourpre s'entrouvre dévoilant un impressionnante
      façade avec des tranches multicolores. Un murmure s'élève de la salle. \" Ça
      claque, n'est-ce pas ? Bien mieux qu'un écran, tout en étant parfaitement personnalisable.
      Il existe des milliers de façon de créer le vôtre. \"\r\n\r\nMark Gutenberg
      esquisse un petit sourire. \" Mais maintenant passons aux prouesses techniques
      du produit, ajoute-t-il. Il n'envoie aucun rayon et le texte ne défile pas,
      permettant donc de reposer vos yeux. Cela vous procure un bien meilleur sommeil,
      vous permettant d'être bien plus efficace que vos collègues qui ont bingewatché
      Disneyflix toute la nuit. Mais il y a plus. Notre service R&D, épaulé par des
      scientifiques, a établi que l'objet apportait de ce fait 1/ une bien meilleure
      mémorisation que les produits numériques ( spatial memory) ; 2/ les conditions
      propices à une lecture profonde ( deep reading) à la place de votre robot ;
      3/ une sensation unique de connexion émotionnelle ( emotionnal connection) et
      4/ une réduction des effets perturbateurs des activités multitâches ( multitasking).
      \"\r\n\r\nSoudain, il brandit l'objet vers le ciel. \" Et puis, il vous permet
      de reprendre votre liberté. Pas de mouchard qui analyse vos lectures dans un
      centre de données pour vous enfermer dans un algorithme. Vous pouvez décider
      enfin librement de vos lectures. Vous êtes libre aussi d'en faire ce que vous
      voulez : l'échanger, le prêter ou même l'offrir. \" Pour le prouver, Mark Gutenberg
      demande alors à l'assistance que chacun échange l'objet avec son voisin. \"
      L'auriez-vous fait avec votre liseuse ou votre smartphone ? \" Chacun s'y prête
      de bonne grâce, regardant le nouvel objet reçu avec curiosité.\r\n\r\n\" Voilà.
      Avec nos équipes de communication, nous avons décidé de l'appeler BOOK pour
      Big Opportunities Of Knowledge car il va vous offrir des occasions illimités
      de mieux connaître le monde, les autres et soi-même \", poursuit Mark Gutenberg.
      \" Et notre business plan, vous demandez-vous ? Pas question que cette innovation
      soit mise en ligne. Nous allons créer de vrais lieux d'expérience humaine où
      des personnes vous conseillent - sans l'aide d'aucun robot ou algorithme - et
      vous ouvrent à de nouvelles découvertes. \"\r\n"
